package main

import "fmt"

func hasGroupsSizeX(deck []int) bool {
	len := len(deck)
	group := make(map[int]int)
	for i := 0; i < len; i++ {
		group[deck[i]]++
	}

	for _, v := range group {
		if v < 2 {
			return false
		}
	}

	for i := 2; i <= len; i++ {
		if len%i == 0 {
			flag := true
			for _, v := range group {
				if v%i != 0 {
					flag = false
					break
				}
			}

			if flag {
				return flag
			}
		}
	}

	return false
}

func test01() {
	deck := []int{1, 2, 3, 4, 4, 3, 2, 1}
	success := true
	succResult := [][]int{{1, 1}, {2, 2}, {3, 3}, {4, 4}}

	fmt.Println("test01 deck:=", deck)
	fmt.Println("success:=", success)
	fmt.Println("success result:=", succResult)
	fmt.Println("result:=", hasGroupsSizeX(deck))
	fmt.Println()
}

